// src/pages/manager/ManagerAllUsers.jsx
import React from "react";
import { mockAllUsers } from "../../data/Mockdata";

const ManagerAllUsers = () => {
  return (
    <div className="container my-4">
      <h2 className="fw-bold mb-3">All Users</h2>

      <div
        className="card shadow-sm"
        style={{
          background: "hsl(215, 25%, 12%)",
          border: "1px solid hsl(215, 20%, 25%)",
          color: "white",
        }}
      >
        <div
          className="card-header fw-bold"
          style={{ background: "hsl(215,25%,18%)" }}
        >
          User List
        </div>

        <div
          className="card-body"
          style={{
            maxHeight: "420px",
            overflowY: "auto",
            padding: 0,
          }}
        >
          <table
            className="table table-bordered mb-0"
            style={{
              backgroundColor: "#191f24",
              color: "white",
              borderColor: "hsl(215,25%,25%)",
            }}
          >
            <thead
              style={{
                background: "hsl(215,25%,18%)",
                position: "sticky",
                top: 0,
                zIndex: 10,
              }}
            >
              <tr>
                <th style={{ padding: "12px" }}>Name</th>
                <th style={{ padding: "12px" }}>Role</th>
                <th style={{ padding: "12px" }}>Email</th>
                <th style={{ padding: "12px" }}>Phone</th>
              </tr>
            </thead>

            <tbody>
              {mockAllUsers.map((user, i) => (
                <tr
                  key={i}
                  style={{
                    background:
                      i % 2 === 0
                        ? "hsl(215,25%,14%)"
                        : "hsl(215,25%,16%)",
                  }}
                >
                  <td style={{ padding: "12px" }}>{user.name}</td>
                  <td style={{ padding: "12px" }}>{user.role}</td>
                  <td style={{ padding: "12px" }}>{user.email}</td>
                  <td style={{ padding: "12px" }}>{user.phone}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default ManagerAllUsers;
